import React from 'react';
import '../sass/components/banner.scss';

function Banner() {
    return (
        <>
            <div>
                <div className="banner">
                    <p className="banner-title">
                        Chez vous, partout et ailleurs
                    </p>
                </div>
            </div>
        </>
    );
}

export default Banner;
